import React from 'react';

const Dashboard = () => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100 p-4">
      <div className="w-full max-w-6xl bg-white shadow-lg rounded-lg p-6">
        <h1 className="text-2xl font-bold mb-4 text-center text-gray-800">Art Career Insights Dashboard</h1>

        {/* Embed your dashboard iframe here */}
        <div className="w-full aspect-video">
          <iframe
            src="https://public.tableau.com/views/YourDashboardLinkHere"
            title="Art Career Dashboard"
            width="100%"
            height="600"
            frameBorder="0"
            allowFullScreen
          ></iframe>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
